  false,\n\t\"url\": null,\n\t\"notes\": \"The goal of wildlife inventories is to
  provide sufficient data needed to manage the refuge toward its stated objectives,
  and to compile population data for evaluation and planning purposes. The Wildlife
  Inventory Plan is written to serve as the main tool in obtaining this goal. The
  Wildlife Inventory Plan is written to 1) standardize inventory procedures, thereby
  increasing the accuracy of data collected; 2) provide guidelines specific to the
  Wapello District for collection of wildlife population data; and 3) determine the
  estimated time requirements and associated costs with each inventory procedure.
  The data collected will also be available to state agencies, private organizations,
  and the general public for their information on the status of area wildlife.\",\n\t\"license_title\":
